import React from 'react'
import { Link } from 'react-router-dom'

  function ComponentHeader() {
    return (
        <div>
            <ul>
                <li><Link to="/" >Home</Link></li>
                <li><Link to="/about" >About</Link></li>
                <li><Link to="/clients" >client</Link></li>
            </ul>
        </div>
    )
}

export default ComponentHeader;
